function addName() {
  const div = document.createElement('div');

  div.className = 'row';
  div.id = "row"

  div.innerHTML = `
  <br>
  <div class="autocomplete" style="width:300px;">
    <input id="myInput" type="text" name="nm1" placeholder="CURRENTLY WORKING ADD (ERROR)">
  </div>   
    <input class="button" type="button" value="remove" onclick="removeName();" style="width:200px; background-color: rgb(173, 34, 9);">  
  <br>
  `;

  document.getElementById('form').appendChild(div);

};

// =================================================================================== //

function removeName() { //WORK ON//
  // select the target element
  const e = document.querySelector(".row:last-child");
  e.parentElement.removeChild(e);

};

