function json(data) {  //Pass python data to html to js function
  myvar = JSON.parse(data);
  titles = [];
  percentage_wins = [];

  for (var i=0; i<myvar.length; i++) {
    titles.push((myvar[i]["Title"]));
    percentage_wins.push((myvar[i]["Percentage_wins"]))
  }
  console.log(titles);
  console.log(percentage_wins);

  
}

// =================================================================================== //

async function chartCreate(data) {

  myvar = JSON.parse(data);
  titles = [];
  percentage_wins = [];
  total_rec = [];
  total_scored = [];
  indicator = [];


  for (var i=0; i<myvar.length; i++) {
    titles.push((myvar[i]["Title"]));
    percentage_wins.push((myvar[i]["Percentage_wins"])*100);
    total_rec.push((myvar[i]["Total_Received"]));
    total_scored.push((myvar[i]["Total_scored"]));
    indicator.push((myvar[i]["Indicator"]));


  }

  var ctx = document.getElementById('chart').getContext('2d');
  var xlabels = titles;
  var myChart = new Chart(ctx, {
      type: 'bar',
      data: {
          labels: xlabels,
          datasets: [{
              label: 'Win Percentages',
              data: percentage_wins,
              backgroundColor: [
                'rgba(255, 99, 132, 0.3)',
                
              ],
              borderColor: [
                'rgb(255, 99, 132)',
          
              ],
              borderWidth: 1
          },

          {
            label: 'Indicator',
              data: indicator,
              backgroundColor: [
                'rgba(255, 159, 64, 0.3)',
                
              ],
              borderColor: [
                'rgba(255, 159, 64, 1)',
          
              ],
              borderWidth: 1
          },

          {
            label: 'Touches Received',
              data: total_rec,
              backgroundColor: [
                'rgba(153, 102, 255, 0.3)',
                
              ],
              borderColor: [
                'rgba(153, 102, 255, 1)',
          
              ],
              borderWidth: 1
          },

          {
            label: 'Touches Scored',
              data: total_scored,
              backgroundColor: [
                'rgba(75, 192, 192, 0.3)',
                
              ],
              borderColor: [
                'rgba(255, 205, 86, 1)',
          
              ],
              borderWidth: 1
          }
        
        
        ],
          

      },
      options: {
        scales: {

        },
          responsive: false,
          maintainAspectRatio: true,
      }
          
  });
}


